const Weekdays = ({ weekdays }) => {
    return (
        <div className='week'>
            {weekdays.map((weather) => (
                <Weather key={weather.id} weather={weather}/>
            ))}
        </div>
    )
}

const [last] = [...Weekdays].reverse();

export default Weekdays

